  //   });
  //   console.log(counts);

  console.log(cartProducts);

  return (
    <div>
      {cartProducts.map((x, i) => (
        <CartProduct
          key={i}
          item={x}
          filtered={filtered}
          setFilterd={setFilterd}
        />
      ))}
    </div>
  );
}

export default CartPage;
